import React from 'react';

function handleText(ev) {
  ev.preventDefault();
  p.innerHTML = ev.target.value;
}

const App = () => {
  return (
    <div>
      <input type='text' onKeyUp={handleText}></input>
      <p></p>
    </div>
  );
};

export default App;
